import React, { useState, useEffect } from 'react';

const StaffList = () => {
  const [staff, setStaff] = useState([]);

  useEffect(() => {
    fetch('http://127.0.0.1:3010/getdocdtls')
      .then(response => {
        if (!response.ok) {
          throw new Error('Network response was not ok');
        }
        return response.json();
      })
      .then(data => {
        console.log(data);
        setStaffMembers(data);
      })
      .catch(error => {
        console.error('Error:', error);
        response.text().then(text => console.error('Response:', text)); // Get the response text
      });
  }, []);

  return (
    <div>
      <h2>Staff Members</h2>
      <ul>
        {staff.map((member, index) => (
          <li key={index}>
            <strong>Name:</strong> {member.first_name} {member.last_name}<br />
            <strong>Date of Birth:</strong> {new Date(member.dob).toLocaleDateString()}<br />
            <strong>Degree Type:</strong> {member.degree_type}<br />
            <strong>Created Timestamp:</strong> {new Date(member.creat_timestamp).toLocaleString()}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default StaffList;
